import React from 'react';
import { PawPrint, Camera } from 'lucide-react';
import Input from '../common/Input';

const PetInfo = ({ data, onUpdate }) => {
  const petTypes = [
    'Σκύλος', 'Γάτα', 'Πουλί', 'Κουνέλι',
    'Χάμστερ', 'Ερπετό', 'Ψάρι', 'Άλλο'
  ];

  const handlePhotoUpload = (e) => {
    const file = e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        onUpdate({ petPhoto: reader.result });
      };
      reader.readAsDataURL(file);
    }
  };

  return (
    <div>
      <h2 className="text-2xl font-bold text-gray-800 mb-6 flex items-center">
        <PawPrint className="w-6 h-6 mr-2 text-indigo-600" />
        Στοιχεία Κατοικιδίου
      </h2>

      <div className="space-y-4">
        {/* Photo Upload */}
        <div>
          <label className="block text-sm font-semibold text-gray-700 mb-2">
            Φωτογραφία (προαιρετικό)
          </label>
          <div className="flex items-center space-x-4">
            {data.petPhoto && (
              <img
                src={data.petPhoto}
                alt="Pet"
                className="w-24 h-24 rounded-full object-cover border-4 border-indigo-100"
              />
            )}
            <label className="cursor-pointer bg-gray-100 hover:bg-gray-200 px-6 py-3 rounded-lg flex items-center transition-colors">
              <Camera className="w-5 h-5 mr-2" />
              {data.petPhoto ? 'Αλλαγή Φωτογραφίας' : 'Επιλογή Φωτογραφίας'}
              <input
                type="file"
                accept="image/*"
                onChange={handlePhotoUpload}
                className="hidden"
              />
            </label>
          </div>
        </div>

        {/* Pet Name */}
        <Input
          label="Όνομα Κατοικιδίου"
          type="text"
          value={data.petName}
          onChange={(e) => onUpdate({ petName: e.target.value })}
          placeholder="π.χ. Μπομπ"
          icon={PawPrint}
          required
        />

        {/* Pet Type */}
        <div>
          <label className="block text-sm font-semibold text-gray-700 mb-2">
            Τύπος Κατοικιδίου <span className="text-red-500">*</span>
          </label>
          <select
            value={data.petType}
            onChange={(e) => onUpdate({ petType: e.target.value })}
            className="w-full px-4 py-3 border-2 border-gray-300 rounded-lg focus:border-indigo-500 focus:outline-none"
          >
            <option value="">Επιλέξτε τύπο</option>
            {petTypes.map((type) => (
              <option key={type} value={type}>{type}</option>
            ))}
          </select>
        </div>

        {/* Breed & Age */}
        <div className="grid grid-cols-2 gap-4">
          <Input
            label="Ράτσα"
            type="text"
            value={data.petBreed}
            onChange={(e) => onUpdate({ petBreed: e.target.value })}
            placeholder="π.χ. Golden Retriever"
          />

          <Input
            label="Ηλικία"
            type="text"
            value={data.petAge}
            onChange={(e) => onUpdate({ petAge: e.target.value })}
            placeholder="π.χ. 3 χρόνια"
          />
        </div>

        {/* Special Needs */}
        <div>
          <label className="block text-sm font-semibold text-gray-700 mb-2">
            Ιδιαίτερες Ανάγκες (προαιρετικό)
          </label>
          <textarea
            value={data.specialNeeds}
            onChange={(e) => onUpdate({ specialNeeds: e.target.value })}
            placeholder="π.χ. Αλλεργίες, φάρμακα, συμπεριφορά..."
            rows="4"
            className="w-full px-4 py-3 border-2 border-gray-300 rounded-lg focus:border-indigo-500 focus:outline-none"
          />
        </div>
      </div>
    </div>
  );
};

export default PetInfo;
